import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Head.css';

const Head = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const navigate = useNavigate();

    const handllogoClick = () => {
        console.log("Logo clicked");
        navigate('/portfolios');
    };

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    const handleMenuItemClick = (path) => {
        navigate(path);
        setIsMenuOpen(false); // Close the menu after navigation
    };

    return (
        <header>
            <nav className="curve">
                <i 
                    className="bi bi-list" 
                    style={{ fontSize: "2rem", cursor: "pointer" }} 
                    onClick={toggleMenu}
                ></i>
                <img 
                    src="/logo.png" 
                    alt="ICA Logo" 
                    className="img-fluid mainlogo" 
                    onClick={handllogoClick}
                />
                <i 
                    className="bi bi-person" 
                    style={{ fontSize: "2rem", color: "white" }} 
                ></i>
            </nav>
            
            {/* Side Menu */}
            {isMenuOpen && (
                <div className="side-menu">
                    <div class="side-menu-content">
  <i class="bi bi-x" style="font-size: 2rem; cursor: pointer;"></i>
  <div class="menu-header">
    <img src="/profile.png" alt="Profile" class="profile-picture" />
    <h3>Arjun Patel</h3>
  </div>
  <ul class="menu-items">
    <li>Profile</li>
    <li>Home</li>
    <li>Scan QR Code</li>
    <li>Sign Out</li>
  </ul>
  <div class="menu-footer">
    <img src="/logo.png" alt="ICA Logo" class="img-fluid" />
    <p>ITALIAN WOOD FINISHES</p>
  </div>
</div>

                </div>
            )}
        </header>
    );
};

export default Head;
